import React from "react";
import './Card.css';

const Card = ({ title, description, image, link}) => {
    return(
    <div className="card">
      <img src={ image } alt={title} />
      <div className="card-body">
        <h3>{title}</h3>
        <p>{description}</p>
        <a href={link} target="_blank" rel="noopener noreferrer">View Project </a>
      </div>
    </div>
    );
};

export default Card;
